import React, {Component} from 'react';
import './Welcome.css';

class Welcome extends Component{

    render(){
        return(
            <div id="main">
                <h2 id="welcomeText">Welcome to KostumeArt Platform</h2>
                <nav class="menu">
                    <div class="menu__right">
                        <ul class="menu__list">
                            <li class="menu__list-item"><a class="menu__link menu__link--active" href="/InsertCostume">Home</a></li>
                            <li class="menu__list-item"><a class="menu__link" href="#">About</a></li>
                            <li class="menu__list-item"><a class="menu__link" href="#">Portfolio</a></li>
                            <li class="menu__list-item"><a class="menu__link" href="#">Contact</a></li>
                        </ul>
                    </div>
                </nav>
                </div>
           
           
        );
    }
}

export default Welcome;
